import React from 'react';
import Card from './Card';

const cardList = ({ starPeople }) => {
  return (
    <div>
      {starPeople.map((Person, i) => {
        return (
          <Card
            key={i}
            name={Person[i].name}
            height={Person[i].height}
            mass={Person[i].mass}
            gender={Person[i].gender}
            birth_year={Person[i].birth_year}
          />
        );
      })}
    </div>
  );
};

export default cardList;
